import React, { Component } from 'react'

export default class users extends Component {
    click =(e) =>{
        console.log(this.user.name)
      }
  render() {
    return (
      <div>
        <table className='bg-dark text-white w-75 m-auto mt-5 '>
            <thead className='p-5'>
                <th scope='col'>İD</th>
                <th scope='col'>NAME</th>
                <th scope='col'>LAST-NAME</th>
                <th scope='col'>E-MAİL</th>
                
            </thead>
           
           {
            this.props.kategori.map(user => (
               
                <tbody>
                    <td>{user.id}</td>
                    <td>{user.name}</td>
                    <td>{user.lastname}</td>
                    <td>{user.email}</td>
                    <td><button className='btn btn-danger mb-2'  onClick={this.click.bind(this)} >Delete</button></td>
                </tbody>
            )


             )
           }

            
           
        </table>
      </div>
    )
  }
}
